description:
&quot;DMSO is a natural chemical compound derived from trees as a by-product from paper manufacturing. DMSO has been called a new medical principle and a true wonder drug. It has proven effective, either by itself or in combination with other products in the treatment of nearly every ailment known.

There has been much controversy about DMSO over the last 50 years. It is one of the most studied medical products ever. Thousands of scientific articles have been written about DMSO. When used properly it is one of the safest products know. It is also very cheap to produce.

This book provides the documentation needed to show that DMSO is probably the most important product ever for the relief of human suffering.&quot;
